DROP TABLE IF EXISTS `itemmonthsale`;

DROP VIEW IF EXISTS `itemmonthsale`;
CREATE VIEW `itemmonthsale`  AS SELECT `wo`.`month` AS `month`, CASE WHEN `wo`.`quantity` > `wt`.`quantity` THEN `wo`.`nameItem` WHEN `wo`.`quantity` <= `wt`.`quantity` THEN `wt`.`nameItem` END AS `nameItem`, CASE WHEN `wo`.`quantity` > `wt`.`quantity` THEN `wo`.`quantity` WHEN `wo`.`quantity` <= `wt`.`quantity` THEN `wt`.`quantity` END AS `quantity`, CASE WHEN `wo`.`quantity` > `wt`.`quantity` THEN `wo`.`totalAmount` WHEN `wo`.`quantity` <= `wt`.`quantity` THEN `wt`.`totalAmount` END AS `totalAmount` FROM (`windowone` `wo` left join `windowtwo` `wt` on(`wt`.`month` = `wo`.`month`))  ;
DROP TABLE IF EXISTS `mainrequest`;

DROP VIEW IF EXISTS `mainrequest`;
CREATE VIEW `mainrequest`  AS SELECT `od`.`ID_ORDER` AS `ID_MAIN`, `it`.`nameItem` AS `nameItem`, `cu`.`email` AS `email`, `ct`.`name` AS `name`, ucase(concat_ws(' ',`cu`.`firstName`,`cu`.`lastName`)) AS `fullName`, count(1) AS `quantityTransaction`, sum(`od`.`quantity`) AS `quantity`, sum(`od`.`payment`) AS `amount`, sum(`od`.`tax`) AS `tax`, `od`.`payment`+ `od`.`tax` AS `totalAmount`, `od`.`dateCreateAt` AS `dateCreateAt`, year(`od`.`dateCreateAt`) AS `year`, monthname(`od`.`dateCreateAt`) AS `month`, `it`.`dateDropItem` AS `dateDropItem` FROM (((`order` `od` left join `item` `it` on(`it`.`ID_ITEM` = `od`.`idItemOrder`)) left join `category` `ct` on(`ct`.`ID_CATEGORY` = `it`.`itemCategoryType`)) left join `customer` `cu` on(`cu`.`ID_CUSTOMER` = `od`.`idCustomer`)) WHERE `od`.`statusOrder` = 'Completed' AND `it`.`statusItem` = 1 GROUP BY `it`.`nameItem` ORDER BY `od`.`ID_ORDER` ASC  ;
DROP TABLE IF EXISTS `quantitysales`;

DROP VIEW IF EXISTS `quantitysales`;
CREATE VIEW `quantitysales`  AS SELECT `mainrequest`.`ID_MAIN` AS `ID_MAIN`, `mainrequest`.`month` AS `month`, sum(`mainrequest`.`quantity`) AS `quantitySales` FROM `mainrequest` GROUP BY `mainrequest`.`month`  ;
DROP TABLE IF EXISTS `totalamountmounth`;

DROP VIEW IF EXISTS `totalamountmounth`;
CREATE VIEW `totalamountmounth`  AS SELECT `mainrequest`.`month` AS `month`, sum(`mainrequest`.`totalAmount`) AS `totalAmount` FROM `mainrequest` GROUP BY `mainrequest`.`month``month`  ;
DROP TABLE IF EXISTS `windowone`;

DROP VIEW IF EXISTS `windowone`;
CREATE VIEW `windowone`  AS SELECT `windowone`.`row_num` AS `row_num`, `windowone`.`month` AS `month`, `windowone`.`nameItem` AS `nameItem`, `windowone`.`quantity` AS `quantity`, `windowone`.`totalAmount` AS `totalAmount` FROM (select row_number() over ( partition by `mainrequest`.`month` order by `mainrequest`.`quantity` desc) AS `row_num`,`mainrequest`.`month` AS `month`,`mainrequest`.`nameItem` AS `nameItem`,`mainrequest`.`quantity` AS `quantity`,`mainrequest`.`totalAmount` AS `totalAmount` from `mainrequest`) AS `windowone` WHERE `windowone`.`row_num` = 11  ;
DROP TABLE IF EXISTS `windowtwo`;

DROP VIEW IF EXISTS `windowtwo`;
CREATE VIEW `windowtwo`  AS SELECT `windowtwo`.`row_num_amount` AS `row_num_amount`, `windowtwo`.`month` AS `month`, `windowtwo`.`nameItem` AS `nameItem`, `windowtwo`.`quantity` AS `quantity`, `windowtwo`.`totalAmount` AS `totalAmount` FROM (select row_number() over ( partition by `mainrequest`.`month` order by `mainrequest`.`totalAmount` desc) AS `row_num_amount`,`mainrequest`.`month` AS `month`,`mainrequest`.`nameItem` AS `nameItem`,`mainrequest`.`quantity` AS `quantity`,`mainrequest`.`totalAmount` AS `totalAmount` from `mainrequest`) AS `windowtwo` WHERE `windowtwo`.`row_num_amount` = 11  ;


